(1, 'Apples', 'apples', 'An apple is a sweet, edible fruit produced by an apple tree (Malus domestica). Apple trees are ... The skin of ripe apples is generally red, yellow, green, pink, or russetted, though many bi- or tri-colored cultivars may be found.', 1, 2.00, 6, 1.60, '1', 18, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"1\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1/Apples.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1/conversions/Apples-thumbnail.jpg\"}', '[{\"id\": \"573\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/572/apple-1.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/572/conversions/apple-1-thumbnail.jpg\"}, {\"id\": \"574\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/573/apple-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/573/conversions/apple-2-thumbnail.jpg\"}, {\"id\": \"575\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/574/apple.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/574/conversions/apple-thumbnail.jpg\"}, {\"id\": \"737\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/736/apple-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/736/conversions/apple-2-thumbnail.jpg\"}]', NULL, '2021-03-07 20:24:53', '2021-06-26 13:56:42', NULL, NULL),
(2, 'Baby Spinach', 'baby-spinach', 'Spinach (Spinacia oleracea) is a leafy green flowering plant native to central and western Asia. It is of the order Caryophyllales, family Amaranthaceae, subfamily Chenopodioideae. Its leaves are a common edible vegetable consumed either fresh.', 1, 0.60, 6, NULL, '2', 10, 1, 0, NULL, 'publish', 'simple', '2lb', NULL, NULL, NULL, '{\"id\": \"2\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/2/BabySpinach.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/2/conversions/BabySpinach-thumbnail.jpg\"}', '[{\"id\": \"576\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/575/baby-spinach-1.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/575/conversions/baby-spinach-1-thumbnail.jpg\"}, {\"id\": \"577\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/576/baby-spinach-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/576/conversions/baby-spinach-2-thumbnail.jpg\"}, {\"id\": \"578\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/577/baby-spinach.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/577/conversions/baby-spinach-thumbnail.jpg\"}, {\"id\": \"738\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/737/BabySpinach_xronqz.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/737/conversions/BabySpinach_xronqz-thumbnail.jpg\"}]', NULL, '2021-03-07 20:26:13', '2021-06-26 13:56:42', NULL, NULL),
(3, 'Blueberries', 'blueberries', 'Blueberries are perennial flowering plants with blue or purple berries. They are classified in the section Cyanococcus within the genus Vaccinium. Vaccinium also includes cranberries, bilberries, huckleberries and Madeira blueberries. Commercial blueberries—both wild and cultivated —are all native to North America.', 1, 3.00, 6, NULL, '3', 30, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"3\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/3/blueberries.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/3/conversions/blueberries-thumbnail.jpg\"}', '[{\"id\": \"580\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/579/Bluberries-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/579/conversions/Bluberries-2-thumbnail.jpg\"}, {\"id\": \"581\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/580/Bluberries.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/580/conversions/Bluberries-thumbnail.jpg\"}, {\"id\": \"740\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/739/blueberries_relyfn.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/739/conversions/blueberries_relyfn-thumbnail.jpg\"}]', NULL, '2021-03-07 20:40:00', '2021-06-26 13:56:42', NULL, NULL),
(4, 'Brussels Sprout', 'brussels-sprout', 'The Brussels sprout is a member of the Gemmifera Group of cabbages, grown for its edible buds. The leaf vegetables are typically 1.5–4.0 cm in diameter and look like miniature cabbages. The Brussels sprout has long been popular in Brussels, Belgium, and may have gained its name there.', 1, 5.00, 6, 3.00, '4', 17, 1, 0, NULL, 'publish', 'simple', '1lb', NULL, NULL, NULL, '{\"id\": \"4\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/4/BrusselsSprouts.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/4/conversions/BrusselsSprouts-thumbnail.jpg\"}', '[{\"id\": \"582\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/581/Brussels-Sprout-1.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/581/conversions/Brussels-Sprout-1-thumbnail.jpg\"}, {\"id\": \"583\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/582/Brussels-Sprout-2.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/582/conversions/Brussels-Sprout-2-thumbnail.jpg\"}, {\"id\": \"584\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/583/Brussels-Sprout.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/583/conversions/Brussels-Sprout-thumbnail.jpg\"}, {\"id\": \"741\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/740/BrusselsSprouts_adwhet.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/740/conversions/BrusselsSprouts_adwhet-thumbnail.jpg\"}]', NULL, '2021-03-07 20:42:32', '2021-06-26 13:56:42', NULL, NULL),
